import React from "react";

export default function Header() {
  return (
    <div className="topnav">
      <a className="logo" href="/">
        Movie maker
      </a>
      <div className="search-container">
        <form>
          <a href="/">Add Movies </a>
          <input type="text" placeholder="search..." />
          <button type="submit">Submit</button>
        </form>
      </div>
    </div>
  );
}
